  input: TEXT,F3XA,,"This amendment is filed in response to the Commissions's prelimimary
    review letter dated July 11, 2007.  Item 1  Republican Federal Committee of PA
    feels that we have complied with the FEC's regulations regarding salaries and
    wages.  This is a non-federal election year in PA with judicial races being our
    focus. We do not have any employees who are spending more that 25% of the their
    time on federal election activity at the present time.  Item 2 The Levin Account
    cash balance should be self-correcting after these amendments have been made.
    Monthly reports were filed before the amendments for prior periods were filed.
    Item 6 Republican Federal Committee of PA had inadvertly transferred funds to
    the federal account  for CC Luncheon disbursement from November 11, 2006 (non
    federal portion) that was outside the 60 day window after the vendor had been
    paid.  $2,950.38 has been transferred to our non-federal account on 8/03/07 to
    correct this error.  "
